// src/router/index.js
import { createRouter, createWebHistory } from 'vue-router';
import Home from '../views/Home.vue';
import Lobby from '../views/Lobby.vue';
import GameSetup from '../views/GameSetup.vue';
import SinglePlayerGamePlay from '../components/SinglePlayerGamePlay.vue';
import MultiPlayerGamePlay from '../components/MultiPlayerGamePlay.vue';
import Login from '../views/Login.vue';
import Register from '../views/Register.vue';
var routes = [{
  path: '/',
  name: 'Home',
  component: Home
}, {
  path: '/lobby',
  name: 'Lobby',
  component: Lobby
}, {
  path: '/setup',
  name: 'GameSetup',
  component: GameSetup
}, {
  path: '/singleplayer',
  name: 'SinglePlayerGamePlay',
  component: SinglePlayerGamePlay
}, {
  path: '/multiplayer',
  name: 'MultiPlayerGamePlay',
  component: MultiPlayerGamePlay
}, {
  path: '/login',
  name: 'Login',
  component: Login
}, {
  path: '/register',
  name: 'Register',
  component: Register
}];
var router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes: routes
});
export default router;
